<template>
  <div class="flex flex-col gap-8 p-4 md:p-16">
    <div class="grid grid-cols-1 gap-8">
      <div class="flex flex-col items-center gap-8">
        <AddTile @add-tile="addTile" />
        <div class="grid grid-cols-1 w-full gap-4 mb-4 md:grid-cols-2 lg:grid-cols-2">
          <Tile
            v-for="(tile, index) in paginatedTiles"
            :key="index"
            :tile="tile"
            @delete-tile="deleteTile(index)"
          />
        </div>
        <Pagination
          :currentPage="currentPage"
          :totalItems="tiles.length"
          :itemsPerPage="tilesPerPage"
          @update:currentPage="updatePage"
        />
      </div>
    </div>
    <Messenger />
  </div>
</template>

<script>
import AddTile from './components/AddTile.vue';
import Tile from './components/Tile.vue';
import Pagination from './components/Pagination.vue';
import Messenger from './components/Messenger.vue';

export default {
  components: {
    AddTile,
    Tile,
    Pagination,
    Messenger
  },
  data() {
    return {
      tiles: JSON.parse(localStorage.getItem('tiles')) || [
        {
          Name: "Name",
          Description: "Some desc",
          Image: "data:image/jpeg;base64,",
          Price: 101
        },
        {
          Name: "Name",
          Description: "Some desc",
          Image: "data:image/jpeg;base64,",
          Price: 101
        },
        {
          Name: "Name",
          Description: "Some desc",
          Image: "data:image/jpeg;base64,",
          Price: 101
        },
        {
          Name: "Name",
          Description: "Some desc",
          Image: "data:image/jpeg;base64,",
          Price: 101
        },
      ],
      currentPage: 1,
      tilesPerPage: 4
    };
  },
  computed: {
    paginatedTiles() {
      const start = (this.currentPage - 1) * this.tilesPerPage;
      const end = start + this.tilesPerPage;
      return this.tiles.slice(start, end);
    }
  },
  methods: {
    updatePage(page) {
      this.currentPage = page;
    },
    addTile(newTile) {
      this.tiles.push(newTile);
      localStorage.setItem('tiles', JSON.stringify(this.tiles));
    },
    deleteTile(index) {
      const actualIndex = (this.currentPage - 1) * this.tilesPerPage + index;
      this.tiles.splice(actualIndex, 1);
      localStorage.setItem('tiles', JSON.stringify(this.tiles));
    }
  },
  mounted() {
    localStorage.setItem('tiles', JSON.stringify(this.tiles));
  }
};
</script>
